import { jsPDF } from "jspdf";
import html2canvas from "html2canvas";
import autoTable from 'jspdf-autotable';

const addHeader = (doc, userData) => {
  // Add logo
  const logo = "data:image/png;base64,";
  doc.addImage(logo, "PNG", 10, 10, 50, 30); // Adjust positioning and size

  const tuplogo = "data:image/jpeg;base64,";
  const pageWidth = doc.internal.pageSize.getWidth(); // Get document width
  const logoWidth = 30; // Set logo width
  const logoX = pageWidth - logoWidth - 10; // Position logo on the right with padding
  doc.addImage(tuplogo, "PNG", logoX, 10, logoWidth, 30); // Adjust positioning and size

  // Add text
  doc.setFont("helvetica", "bold");
  doc.setFontSize(30);
  doc.setTextColor(0, 128, 0); // Green color
  doc.text("GreenSphere", 60, 20); // Adjust X to align with the logo

  doc.setFont("helvetica", "normal");
  doc.setFontSize(10);
  doc.setTextColor(0, 0, 0); // Black color
  doc.text("Technological University of The Philippines - Taguig", 60, 30);
  doc.text("KM14 East Service Road, Western Bicutan, Taguig City", 60, 35);
  doc.text("https://www.tupt.edu.ph/", 60, 40);

  // Add user information
  if (userData) {
    doc.setFontSize(10);
    doc.setFont("helvetica", "normal");
    doc.text(`Name: ${userData.name}`, 15, 50);
    doc.text(`Email: ${userData.email}`, 15, 55);
  }

  // Make line thicker and green
  doc.setLineWidth(2); // Slightly thicker
  doc.setDrawColor(0, 128, 0);
  doc.line(10, 60, 200, 60); // Move line slightly lower for better spacing

  return 70; // Adjust Y offset to ensure spacing
};

const generateRecommendations = (data) => {
  const recommendations = [];

  if (!data || Object.keys(data).length === 0) {
    return ["No data available to generate recommendations."];
  }

  // Extract data for analysis
  const totalCosts = Object.values(data).reduce((sum, item) => sum + (item.totalCost || 0), 0);
  const totalCarbonEmissions = Object.values(data).reduce((sum, item) => sum + (item.totalCarbonEmissions || 0), 0);
  const totalAnnualSavings = Object.values(data).reduce((sum, item) => sum + (item.annualSavings || 0), 0);

  const paybackPeriods = Object.entries(data)
    .map(([key, value]) => ({
      source: key,
      paybackPeriod: value.paybackPeriod || Infinity, // Default to large number if missing
    }))
    .filter((item) => !isNaN(item.paybackPeriod));

  const carbonEmissionsBySource = Object.entries(data)
    .map(([key, value]) => ({
      source: key,
      carbonEmissions: value.totalCarbonEmissions || 0,
    }))
    .filter((item) => !isNaN(item.carbonEmissions));

  const annualSavingsBySource = Object.entries(data)
    .map(([key, value]) => ({
      source: key,
      annualSavings: value.annualSavings || 0,
    }))
    .filter((item) => !isNaN(item.annualSavings));

  // Find the source with the lowest payback period
  const bestPaybackSource = paybackPeriods.length
    ? paybackPeriods.reduce((prev, curr) =>
      prev.paybackPeriod < curr.paybackPeriod ? prev : curr
    )
    : null;

  // Find the source with the lowest carbon emissions
  const bestCarbonSource = carbonEmissionsBySource.length
    ? carbonEmissionsBySource.reduce((prev, curr) =>
      prev.carbonEmissions < curr.carbonEmissions ? prev : curr
    )
    : null;

  // Find the source with the highest annual savings
  const bestSavingsSource = annualSavingsBySource.length
    ? annualSavingsBySource.reduce((prev, curr) =>
      prev.annualSavings > curr.annualSavings ? prev : curr
    )
    : null;

  // 🔹 Best payback period
  if (bestPaybackSource && bestPaybackSource.paybackPeriod > 0) {
    recommendations.push(
      `• Based on the Cost vs. Benefit Analysis, ${bestPaybackSource.source} offers the best payback period of ${bestPaybackSource.paybackPeriod.toFixed(2)} years. Investing in this source could yield faster returns.`
    );
  }

  // 🔹 Best for carbon emissions
  if (bestCarbonSource && bestCarbonSource.carbonEmissions > 0) {
    recommendations.push(
      `• ${bestCarbonSource.source} has the lowest carbon emissions (${bestCarbonSource.carbonEmissions} kg CO₂). This is the best option if your goal is to reduce environmental impact.`
    );
  }

  // 🔹 Best for annual savings
  if (bestSavingsSource && bestSavingsSource.annualSavings > 0) {
    recommendations.push(
      `• Small Wind Turbines offers the highest annual savings (${bestSavingsSource.annualSavings.toLocaleString()}). This is the best option if your goal is to maximize financial returns.`
    );
  }

  // 🔹 High carbon emissions
  if (totalCarbonEmissions > 80) {
    recommendations.push(
      "• The total carbon emissions are high. Consider integrating Solar Water Heating or Solar Panels to reduce emissions and improve sustainability."
    );
  }

  // 🔹 High total costs
  if (totalCosts > 4000) {
    recommendations.push(
      "• The total cost of your renewable energy setup is relatively high. Consider Pico Hydro Power or Small Wind Turbines, which are cost-effective for small-scale energy needs."
    );
  }

  // 🔹 Urban area adaptation
  const urbanSources = ["Solar Roof Tiles", "Vertical Farming"];
  const hasUrbanSources = Object.keys(data).some((source) => urbanSources.includes(source));
  if (!hasUrbanSources) {
    recommendations.push(
      "• If you are in an urban area with limited space, consider Solar Roof Tiles or Vertical Farming systems for maximum efficiency."
    );
  }

  // 🔹 Hybrid systems for efficiency
  if (Object.keys(data).length === 1) {
    recommendations.push(
      "• Combining multiple renewable sources (e.g., Solar Panels and Wind Turbines) can enhance efficiency and provide energy stability."
    );
  }

  // 🔹 Regular maintenance
  recommendations.push(
    "• Regular maintenance can extend the lifespan of your energy system and improve cost-effectiveness."
  );

  // 🔹 Energy efficiency measures
  recommendations.push(
    "• Consider energy-efficient appliances and smart grid technology to further reduce energy consumption and enhance sustainability."
  );

  // 🔹 Government incentives
  recommendations.push(
    "• Check for government incentives or subsidies available for renewable energy investments to offset installation costs."
  );

  // 🔹 Battery storage systems (New)
  if (totalCosts > 5000 && totalCarbonEmissions > 100) {
    recommendations.push(
      "• Since your system has high costs and emissions, consider adding battery storage solutions to maximize renewable energy usage and minimize reliance on fossil fuels."
    );
  }

  // 🔹 Seasonal energy variations (New)
  if (Object.keys(data).includes("Solar Panels")) {
    recommendations.push(
      "• If using solar energy, consider backup options like wind or hydro power to maintain energy production during cloudy or rainy seasons."
    );
  }

  return recommendations;
};

const addFooter = (doc, yOffset, data) => {
  if (yOffset + 50 > 280) {
    doc.addPage();
    yOffset = 10;
  }

  // Footer Line
  doc.setLineWidth(2);
  doc.setDrawColor(0, 128, 0);
  doc.line(10, yOffset, 200, yOffset);
  yOffset += 10;

  doc.setFont("times", "normal");
  doc.setFontSize(12);

  const textWidth = 180;

  // Generate recommendations
  const recommendations = generateRecommendations(data);

  // Recommendations Title
  doc.setFont("helvetica", "bold");
  doc.text("Recommendations:", 10, yOffset);
  yOffset += 10;

  // Print each recommendation
  doc.setFont("helvetica", "normal");
  recommendations.forEach((line) => {
    const splitText = doc.splitTextToSize(line, textWidth);
    doc.text(splitText, 10, yOffset);
    yOffset += splitText.length * 7;
  });

  return yOffset + 10;
};

const exportCostBenefit = async (doc, ref, yOffset) => {
  if (ref.current) {
    doc.setFont("helvetica", "normal");
    doc.setFontSize(15);
    doc.setTextColor(0, 0, 0);

    doc.text("Cost vs. Benefit Analysis", 20, yOffset);
    yOffset += 10; // Add space after title

    // Extract table data from ref
    const rows = [];
    const headers = ["Item", "Cost", "Benefit", "Payback Period"]; // No peso sign

    ref.current.querySelectorAll("tr").forEach((row) => {
      const cols = row.querySelectorAll("td, th");
      const rowData = Array.from(cols).map((col) =>
        col.innerText.trim().replace(/±|₱/g, "") // Remove ± and ₱
      );
      if (rowData.length) rows.push(rowData);
    });

    // Add table with improved formatting
    autoTable(doc, {
      startY: yOffset,
      head: [headers],
      body: rows,
      theme: "grid",
      styles: {
        fontSize: 10,
        halign: "left",
        font: "helvetica",
        cellPadding: 2, // Ensure text has space inside cells
      },
      headStyles: { fillColor: [200, 200, 200], textColor: [0, 0, 0] },
      columnStyles: {
        0: { cellWidth: 60 }, // Adjust column width for "Item"
        1: { cellWidth: 40 },
        2: { cellWidth: 40 },
        3: { cellWidth: 40 },
      },
      margin: { left: 10, right: 10 },
    });

    yOffset = doc.lastAutoTable.finalY + 10; // Update yOffset after table
  }
  return yOffset;
};

const exportSavings = async (doc, ref, yOffset) => {
  if (ref.current) {
    // Add a horizontal line to separate the sections
    doc.setLineWidth(2);
    doc.setDrawColor(0, 128, 0); // Green line
    doc.line(10, yOffset, 200, yOffset);
    yOffset += 10; // Adjust spacing after the line

    const canvas = await html2canvas(ref.current);
    const imgData = canvas.toDataURL("image/png");
    const imgHeight = (canvas.height * 190) / canvas.width;
    if (yOffset + imgHeight > 280) {
      doc.addPage();
      yOffset = 10;
    }

    doc.text("Cost vs. Savings Comparison", 15, yOffset);
    doc.addImage(imgData, "PNG", 10, yOffset + 10, 190, imgHeight);
    yOffset += imgHeight + 50; // Adjust spacing after the image
  }
  return yOffset;
};

