const exportTotalCosts = async (doc, ref, yOffset) => {
  if (ref.current) {
    // Add a horizontal line to separate the sections
    doc.setLineWidth(2);
    doc.setDrawColor(0, 128, 0); // Green line
    doc.line(10, yOffset, 200, yOffset);
    yOffset += 10; // Adjust spacing after the line

    doc.setFont("helvetica", "normal");
    doc.setFontSize(15);
    doc.setTextColor(0, 0, 0); // Black text
    doc.text("Total Costs", 15, yOffset);
    yOffset += 10; // Add space before details

    // Extract text content from the ref
    const textLines = ref.current.innerText.split("\n").map((line) => line.trim());

    // Extract specific cost values
    let totalProductCost = "";
    let totalInstallationCost = "";
    let totalMaintenanceCost = "";
    let grandTotal = "";

    textLines.forEach((line) => {
      if (line.startsWith("Total Product Cost:")) {
        totalProductCost = line.replace("Total Product Cost: ₱", "").trim();
      } else if (line.startsWith("Total Installation Cost:")) {
        totalInstallationCost = line.replace("Total Installation Cost: ₱", "").trim();
      } else if (line.startsWith("Total Maintenance Cost:")) {
        totalMaintenanceCost = line.replace("Total Maintenance Cost: ₱", "").trim();
      } else if (line.startsWith("Grand Total:")) {
        grandTotal = line.replace("Grand Total: ₱", "").trim();
      }
    });

    // Format data into table rows
    const rows = [
      ["Total Product Cost", totalProductCost],
      ["Total Installation Cost", totalInstallationCost],
      ["Total Maintenance Cost", totalMaintenanceCost],
      ["Grand Total", grandTotal],
    ];

    // Add table using autoTable for alignment
    autoTable(doc, {
      startY: yOffset,
      head: [["Description", "Amount"]],
      body: rows,
      theme: "grid",
      styles: {
        fontSize: 10,
        halign: "left",
        font: "helvetica",
        cellPadding: 2, // Ensure text has space inside cells
      },
      headStyles: { fillColor: [200, 200, 200], textColor: [0, 0, 0] },
      columnStyles: {
        0: { cellWidth: 100 }, // "Description"
        1: { cellWidth: 80, halign: "right" }, // "Amount"
      },
      margin: { left: 10, right: 10 },
    });

    return doc.lastAutoTable.finalY + 20; // Update yOffset after table
  }
  return yOffset;
};

