const ExportToPDF = async (costBenefitRef, savingsRef, carbonRef, energyUsageRef, totalCostRef, costBreakdownRef, data, userData) => {
  const doc = new jsPDF();
  let yOffset = addHeader(doc, userData); // Pass userData to addHeader

  yOffset = await exportCostBenefit(doc, costBenefitRef, yOffset);
  yOffset = await exportSavings(doc, savingsRef, yOffset);
  yOffset = await exportCarbon(doc, carbonRef, yOffset);
  yOffset = await exportEnergyUsage(doc, energyUsageRef, yOffset);
  yOffset = await exportCostBreakdown(doc, costBreakdownRef, yOffset);
  yOffset = await exportTotalCosts(doc, totalCostRef, yOffset);

  addFooter(doc, yOffset, data);
  doc.save("Techno-Economic-Analysis.pdf");
  console.log("Data in ExportToPDF:", data);
};

export default ExportToPDF;